import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Navbar } from 'react-bootstrap';
import './Nav_Bar.css';

const Nav_Bar = () => {
  return (
    <div>
      <Navbar bg="my-Blue" variant="dark" sticky="top">
        <Navbar.Brand href="">
          <img alt="" src="./images/icons/favicon.ico" width="30" height="30" className="d-inline-block align-top" /> Present Simple
        </Navbar.Brand>
      </Navbar>
      <Nav variant="pills" defaultActiveKey="/home">
        <Nav.Item>
          <Nav.Link href="/home">Active</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-1">Option2</Nav.Link>
        </Nav.Item>
      </Nav>
    </div>
  );
};

export default Nav_Bar;
